import React, {useState, useEffect, useRef, memo, useCallback} from 'react';
import { Animated, StyleSheet, Image, Text, View, KeyboardAvoidingView, Keyboard, ScrollView, TextInput, TouchableHighlight, TouchableWithoutFeedback, TouchableOpacity, SafeAreaView, Clipboard, ImageBackground, I18nManager} from 'react-native';
import {Dimensions, Platform, AsyncStorage} from "react-native";
import {isTablet} from 'react-native-device-detection';
import { Icon } from 'react-native-elements';
import Modal from 'react-native-modal';
import { Camera } from 'expo-camera';
import SwitchSelector from 'react-native-switch-selector';

import * as Analytics from 'expo-firebase-analytics';

import {AnimateButton} from '../component/AnimateButton'
import {BackButton} from '../component/BackButton'
import {CameraView} from '../component/CameraView'
import {StickerView} from '../component/StickerView'

const screen = Dimensions.get("window");
const screenW = screen.width;
const screenH = screen.height;
const padding = 15;

export default function PlayerScreen({navigation,route}) {
    const deviceWidth = Dimensions.get("window").width;
    const deviceHeight = Platform.OS === "ios"? Dimensions.get("window").height: require("react-native-extra-dimensions-android").get("REAL_WINDOW_HEIGHT");
    const { mode, ai } = route.params;
    const com = 0;
    const [player1Name,setPlayer1Name] = useState("Player1");
    const [player2Name,setPlayer2Name] = useState("Player2");
    const [player1Img,setPlayer1Img] = useState(null);
    const [player2Img,setPlayer2Img] = useState(null);
    const player1 = 1;
    const player2 = 2;
    const [selectPlayer,setSelectPlayer] = useState(null);
    const [keyboardOn,setKeyboardOn] = useState(false);
    const [iconModalOn,setIconModalOn] = useState(false);
    const [hasCameraPermission, setHasCameraPermission] = useState(null);
    const [cameraType, setCameraType] = useState(Camera.Constants.Type.back);
    const [cameraReady, setCameraReady] = useState(false);
    const [cameraZoom, setCameraZoom] = useState(0);
    const cameraRef = useRef(null);
    const tabSwitchRef = useRef(null);
    const [tabOption, setTabOption] = useState([]);
    const selfie = 0;
    const sticker = 1;
    const [selectTabOption, setSelectTabOption] = useState(selfie);

    async function asyncCall(){
        await Analytics.setCurrentScreen('PlayerScreen');
    }
    
    useEffect(()=>{
        asyncCall();

        if(mode==com){
            setPlayer2Name("AI");
        }
        Keyboard.addListener("keyboardWillShow", _keyboardWillShow);
        Keyboard.addListener("keyboardWillHide", _keyboardWillHide);
        setPlayer1Img({'uri':"data:image/png;base64,"},);
        setPlayer2Img({'uri':"data:image/png;base64,"},);
        const tabOption = [
            { label: 'Selfie', value: selfie },
            { label: 'Sticker', value: sticker },
        ];
        setTabOption([...tabOption]);
        // cleanup function
        return () => {
          Keyboard.removeListener("keyboardWillShow", _keyboardWillShow);
          Keyboard.removeListener("keyboardWillHide", _keyboardWillHide);
        };
    },[]);

    useEffect(()=>{
        if(iconModalOn){
            (async () => {
                const { status } = await Camera.requestPermissionsAsync();
                setHasCameraPermission(status === 'granted');
            })();
            tabSwitchRef.current?.toggleItem(selectTabOption);
        }
    },[iconModalOn]);

    useEffect(()=>{
        setIconModalOn(false);
    },[player1Img,player2Img])

    const _keyboardWillShow = () => {
        setKeyboardOn(true);
    };
    
    const _keyboardWillHide = () => {
        setKeyboardOn(false);
    };

    const onStart = ()=>{
        navigation.push("Setting",{
            mode:mode,
            ai:((ai)?ai:{
                level:0
            }),
            p1:{
                name:player1Name,
                img:player1Img,
                score:0,
            },
            p2:{
                name:player2Name,
                img:player2Img,
                score:0,
            },
        });
    }

    const onBack = ()=>{
        navigation.pop();
    }

    const updatePage=(page,updateScrollView)=>{
        setMode(page);
        if(updateScrollView){
            selectScrollView.current.scrollTo({x:page*screenW,animated: true});
        }
    }

    const changeIcon=(player)=>{
        setSelectPlayer(player)
        setIconModalOn(true);
    }

    const updateSelectTab=(value)=>{
        setSelectTabOption(value);
    }

    const RenderTabContent=()=>{
        if(selectTabOption==selfie){
            return(
                <CameraView
                    hasCameraPermission={hasCameraPermission}
                    cameraType={cameraType}
                    setCameraType={setCameraType}
                    cameraRef={cameraRef}
                    cameraReady={cameraReady}
                    setCameraReady={setCameraReady}
                    cameraZoom={cameraZoom}
                    setCameraZoom={setCameraZoom}
                    setImage={(selectPlayer==player1)?setPlayer1Img:setPlayer2Img}
                    outerPadding={25}
                />
            );
        }else{
            return(
                <StickerView
                    setImage={(selectPlayer==player1)?setPlayer1Img:setPlayer2Img}
                    outerPadding={25}
                    usingSticker={(selectPlayer==player1)?player1Img:player2Img}
                />
            );
        }
    }

    return (
        <SafeAreaView style={styles.container}>
            <KeyboardAvoidingView
                behavior={Platform.OS == "ios" ? "padding" : "height"}
                style={styles.container}
                >
                <TouchableWithoutFeedback onPress={Keyboard.dismiss}>
                    <View style={[styles.main]}>
                        <Text style={[styles.title,(keyboardOn)?{padding:0}:{}]}>
                            Player
                        </Text>
                        <View style={styles.push}></View>
                        <View style={[styles.playerList,(keyboardOn)?{paddingTop:0,paddingBottom:0}:{}]}>
                            <View>
                                <Image style={styles.playerImage} source={player1Img} />
                                <TouchableOpacity style={styles.changeIconBtn} onPress={()=>{changeIcon(player1);}}>
                                    <Text style={styles.changeIconBtnText}>Change Icon</Text>
                                </TouchableOpacity>
                            </View>
                            <View style={styles.playerInfo}>
                                <Text style={styles.playerInfoTitle}>Name:</Text>
                                <TextInput onChangeText={(value)=>{setPlayer1Name(value)}} style={styles.playerInfoBox} placeholder={player1Name}></TextInput>
                            </View>
                        </View>
                        <View style={[styles.verius,(keyboardOn)?{paddingTop:0,paddingBottom:0}:{}]}>
                            <Text style={styles.veriusText}>VS</Text>
                        </View>
                        <View style={[styles.playerList,(keyboardOn)?{paddingTop:0,paddingBottom:0}:{}]}>
                            <View>
                                <Image style={styles.playerImage} source={player2Img} />
                                <TouchableOpacity style={styles.changeIconBtn} onPress={()=>{changeIcon(player2);}}>
                                    <Text style={styles.changeIconBtnText}>Change Icon</Text>
                                </TouchableOpacity>
                            </View>
                            <View style={styles.playerInfo}>
                                <Text style={styles.playerInfoTitle}>Name:</Text>
                                <TextInput onChangeText={(value)=>{if(value==""&&mode==com){setPlayer2Name("AI")}setPlayer2Name(value)}} style={styles.playerInfoBox} placeholder={player2Name}></TextInput>
                            </View>
                        </View>
                        <View style={styles.push}></View>
                        <View style={[(keyboardOn)?{display:"none"}:{}]}>
                            <AnimateButton
                                text="Next"
                                offViewValue={1}
                                onViewValue={1.2}
                                offTextValue={0}
                                onTextValue={6}
                                call={onStart}
                            />
                        </View>
                        <BackButton
                            text="Back"
                            call={onBack}
                            delayDisplay={500}
                        />
                    </View>
                </TouchableWithoutFeedback>
            </KeyboardAvoidingView>
            <Modal
            style={styles.modal}
            isVisible={iconModalOn}
            onSwipeComplete={() => setIconModalOn(false)}
            backdropOpacity={0.3}
            onBackdropPress={() => setIconModalOn(false)}
            propagateSwipe={true}
            swipeDirection="down">
                <View style={styles.modalView}>
                    <Text style={styles.modalTitle}>Change Icon</Text>
                    <View style={styles.modalTabView}>
                        <SwitchSelector ref={tabSwitchRef} style={styles.switch} selectedColor={"#0c5460"} buttonColor={"#bee5eb"} borderRadius={0} options={tabOption} fontSize={28} initial={0} onPress={value => updateSelectTab(value)} />
                    </View>
                    <RenderTabContent
                    />
                </View>
            </Modal>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#0f1123',
        alignItems: 'center',
        justifyContent: "space-between",
    },
    modal:{
        margin:0,
        justifyContent:"flex-end"
    },
    modalTitle:{
        fontSize:28,
        color:"#fff",
        padding:padding,
        paddingTop:0,
        alignSelf:"center"
    },
    switch:{
        backgroundColor:"#fff",
    },
    modalView:{
        backgroundColor:"#0f1123",
        padding:25,
        borderTopLeftRadius:35,
        borderTopRightRadius:35,
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: -3,
        },
        shadowOpacity: 0.6,
        shadowRadius: 3,
    },
    modalTabView:{
        height:40,
        backgroundColor:"red",
        marginBottom:padding,
    },
    main:{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center'
    },
    title:{
        fontSize:45,
        color: "#FFF",
        padding:padding,
    },
    playerList:{
        flexDirection:"row",
        alignItems:"center",
        width:screenW,
        padding:padding,
    },
    playerImage:{
        width:(screenW-padding)/3,
        height:(screenW-padding)/3,
        borderWidth:1,
        borderColor:"#fff",
    },
    playerInfo:{
        width:(screenW-padding)/3*2,
    },
    playerInfoTitle:{
        color:"#fff",
        fontSize:28,
        padding:padding,
        paddingBottom:0,
        paddingLeft:padding+5,
    },
    playerInfoBox:{
        backgroundColor:"#fff",
        fontSize:28,
        margin:padding,
        padding:padding,
        paddingLeft:5,
    },
    verius:{
        justifyContent:"center",
        paddingTop:15,
        paddingBottom:15,
    },
    veriusText:{
        color:"#fff",
        fontSize:50,
    },
    push:{
        flex:1
    },
    changeIconBtn:{
        alignItems:"center",
        padding:padding/3,
        backgroundColor:"#d1ecf1",
        marginTop:0,
        borderColor:"#bee5eb",
        borderWidth:1,
        // borderRadius:999,
    },
    changeIconBtnText:{
        color:"#0c5460"
    }
});